[Laravel]
CmdLaravelClearCache = php artisan cache:clear
CmdLaravelClearConfig = php artisan config:clear
CmdLaravelPermissionFresh = php artisan permission:fresh
CmdLaravelConfigCache = php artisan config:cache
CmdLaravelMigrate = php artisan migrate
CmdLaravelDumpAutoload = php artisan dump:autoload
CmdLaravelDbSeed = php artisan db:seed @Options@
CmdLaravelLangSeeder = php artisan db:seed --class=@CommandSeeder@
CmdLaravelModuleMake = php artisan module:make @ModuleName@
CmdLaravelModuleMakeCommand = php artisan module:make-command @CommandName@ @ModuleName@
CmdLaravelModuleMakeMigration = php artisan module:make-migration @CommandName@ @ModuleName@
CmdLaravelModuleMakeSeed = php artisan module:make-seed @CommandName@ @ModuleName@
CmdLaravelModuleMakeController = php artisan module:make-controller @CommandName@ @ModuleName@
CmdLaravelModuleMakeModel = php artisan module:make-model @CommandName@ @ModuleName@ @Options@
CmdLaravelModuleMakeProvider = php artisan module:make-provider @CommandName@ @ModuleName@
CmdLaravelModuleMakeMiddleware = php artisan module:make-middleware @CommandName@ @ModuleName@
CmdLaravelModuleMakeMail = php artisan module:make-mail @CommandName@ @ModuleName@
CmdLaravelModuleMakeNotification = php artisan module:make-notification @CommandName@ @ModuleName@
CmdLaravelModuleMakeListener = php artisan module:make-listener @CommandName@ @ModuleName@ @Options@
CmdLaravelModuleMakeRequest = php artisan module:make-request @CommandName@ @ModuleName@
CmdLaravelModuleMakeEvent = php artisan module:make-event @CommandName@ @ModuleName@
CmdLaravelModuleMakeJob = php artisan module:make-job @CommandName@ @ModuleName@
CmdLaravelModuleMakeFactory = php artisan module:make-factory @CommandName@ @ModuleName@
CmdLaravelModuleMakePolicy = php artisan module:make-policy @CommandName@ @ModuleName@
CmdLaravelModuleMakeRule = php artisan module:make-rule @CommandName@ @ModuleName@
CmdLaravelModuleMakeResource = php artisan module:make-resource @CommandName@ @ModuleName@
CmdLaravelModuleMakeTest = php artisan module:make-test @CommandName@ @ModuleName@
CmdLaravelModuleRouteProvider = php artisan module:route-provider @ModuleName@